scriptlet.script:
String.prototype.lpad = function(padString, length) {
    var str = this;
    while (str.length < length)
        str = padString + str;
    return str;
}
str = indxIntRate;
a = str.lpad("0", 6);

scriptletContext.put("indxIntRate",a);

